import { Component } from "react";
import { ThemeContext } from "../contexts/ThemeContext";


class Navbar extends Component {
    static contextType = ThemeContext;

    render() { 
        return ( 
           <nav>
            <h3>Navbar</h3>
            </nav>
         );
    }
}

export default Navbar;
